import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import img1 from "./Webimg/1.jpg";
import img2 from "./Webimg/2.jpg";
import img3 from "./Webimg/3.jpg";
import img4 from "./Webimg/4.jpg";
import img5 from "./Webimg/5.png";
import img6 from "./Webimg/6.png";
import img7 from "./Webimg/7.jpg";
import img8 from "./Webimg/8.jpg";
import img9 from "./Webimg/9.png";
import img10 from "./Webimg/10.png";
import img11 from "./Webimg/11.png";
import "./webdev.css";
function Webdev() {
  return (
    <div>
      <Container>
        <Row className="webrow-1">
          <Col className="webcol-1" lg={3}>
            <img src={img1} alt="" className="webimg1" />
            <img src={img2} alt="" className="webimg1" />
            <img src={img3} alt="" className="webimg1" />
            <img src={img4} alt="" className="webimg1" />
            <img src={img5} alt="" className="webimg1" />
            <img src={img6} alt="" className="webimg1" />
            <img src={img7} alt="" className="webimg1" />
            <img src={img8} alt="" className="webimg1" />
            <img src={img9} alt="" className="webimg1" />
            <img src={img10} alt="" className="webimg1" />
            <img src={img11} alt="" className="webimg1" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default Webdev;
